import { Button } from '@material-ui/core';

const Header = () => {
  const text = 'Header';

  return (
    <div>
      <span>Pizzaria</span>
      <Button variant="contained">Entrar</Button>
      <Button variant="contained">Cadastrar</Button>
    </div>
  );
};

export default Header;
